import React, { Component } from "react";
import '../../App.css';
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { logoutUser, setCurrentUser } from "../../actions/authAutentications";
import car from '../../immagini/CAR.png';
import { Container, Row, Col, Button } from 'react-bootstrap';
import LocalAtmIcon from '@material-ui/icons/LocalAtm';
import MapIcon from '@material-ui/icons/Map';
import ScheduleIcon from '@material-ui/icons/Schedule';

class HomeCliente extends Component {

  constructor(props) {
    super(props);
  }


   onLogoutClick = e => {
      e.preventDefault();
      this.props.logoutUser();
   };
   

   render(){ 
    const { user } = this.props.auth;

    //Redirect
    if(user.ruolo==='Admin')
    this.props.history.push("/Dashboard");
      return( 
         <div className='HomeCliente'> 
            <Container>
  <Row>
    <Col sm={6}>
      <h1 style={{fontWeight: 'bold'}} className="TestoHomeCliente">Il passaggio di cui <br />hai bisogno <br />e molto altro<h4 style={{fontWeight: '300'}} >Richiedi una corsa, sali sul veicolo e goditi il viaggio.</h4></h1>
    </Col>
    <Col sm={6}><img src={car} alt="fiat-500" className='Fiat'/></Col>
  </Row>
        <br /> <br /> <br /> <br />
        <Row>
    <Col sm></Col>
    <Col sm>
    <Button variant="outline-primary">Prenota</Button>{' '}
    </Col>
    <Col sm>
    <Button variant="outline-primary">Gestione Corsa</Button>{' '}
    </Col>
    <Col sm></Col>
  </Row>
  <Row>
    <Col sm={12}>
      <h1 style={{fontWeight: 'bolder', textAlign: 'center'}}> Trova il mezzo per andare dove vuoi </h1>
    </Col>
  </Row>
  <br /> <br />
  <Row>
    <Col sm style={{textAlign: 'center', marginBottom: '2rem'}}><ScheduleIcon style={{ fontSize: 60, color: "white" }}/><br/><br/><h5 style={{fontWeight: "bolder"}}>PARTI QUANDO VUOI</h5><h6>Richiedi una corsa a qualsiasi ora e in qualsiasi giorno dell'anno.</h6></Col>
    <Col sm style={{textAlign: 'center', marginBottom: '2rem'}}><LocalAtmIcon style={{ fontSize: 60, color: "white" }}/><br/><br/><h5 style={{fontWeight: "bolder"}}>OPZIONI A PREZZI ACCESSIBILI</h5><h6>Confronta i prezzi di tutte le opzioni di corsa, dai tragitti da pendolare giornalieri alle serate speciali.</h6></Col>
    <Col sm style={{textAlign: 'center', marginBottom: '2rem'}}><MapIcon style={{ fontSize: 60, color: "white" }}/><br/><br/><h5 style={{fontWeight: "bolder"}}>UN MODO FACILE PER SPOSTARSI</h5><h6>Tocca per farti accompagnare a destinazione dallâ€™autista o guida tu e divertiti</h6></Col>
  </Row>
</Container>  

         </div>
      ); 
   } 
}

HomeCliente.propTypes = {
    logoutUser: PropTypes.func.isRequired,
    auth: PropTypes.object.isRequired
  };
  
  const mapStateToProps = state => ({
    auth: state.auth
  });
  
  export default connect(
    mapStateToProps,
    { logoutUser }
  )(HomeCliente);
